 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.39vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:4.47vh;font-family:'Oswald';\"><B>Penunggu Karang</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.71vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.71vh;font-family:'Oswald Regular';\">Penunggu Karang yang berada di TITD Cao Fuk Miao adalah roh atau dewa yang diyakini menjaga dan melindungi wilayah tertentu. Di kelenteng ini, Penunggu Karang dipuja sebagai pelindung yang memberikan keselamatan dan kesejahteraan bagi komunitas setempat. Persembahan dan sembahyang dilakukan untuk menghormati dan memohon perlindungan dari Penunggu Karang, mencerminkan kepercayaan lokal yang kuat terhadap kekuatan spiritual yang menjaga alam dan lingkungan sekitar.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.49vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.95vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
