 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.39vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.52vh;font-family:'Oswald';\"><B>Tempat Cuci Buah &amp; Persiapan Sembahyang</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.71vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.08vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.71vh;font-family:'Oswald Regular';\">Di Tempat Ibadah Tri Dharma Cao Fuk Miao, terdapat area khusus untuk mencuci buah dan mempersiapkan persembahan. Buah-buahan dibersihkan di sini untuk memastikan kebersihannya sebelum digunakan dalam ritual sembahyang, sebagai tanda hormat kepada dewa-dewi dan leluhur. Selain itu, area ini juga digunakan untuk menyiapkan dupa, lilin, dan perlengkapan sembahyang lainnya, memastikan semua bahan siap dan layak digunakan dalam upacara keagamaan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.62vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.08vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
