 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.39vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:4.33vh;font-family:'Oswald';\"><B>Altar Sui We </B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:4.33vh;font-family:'Oswald';\"><B>Sen Niang</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.71vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.08vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.71vh;font-family:'Oswald Regular';\">Altar nomor 3 ini Juga terletak di ruang utama (tengah) sebagai altar utama. Sui We Sen Niang adalah Dewi yang dipuja oleh masyarakat Hainan di seluruh dunia, terutama pada daerah-daerah di tepi laut. Dewi ini mungkin dihormati untuk memohon perlindungan dan keberuntungan dalam menjalani kehidupan sehari-hari.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.62vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.08vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
